import{_ as t,c as a,o as e,ae as r}from"./chunks/framework.CyA9lctr.js";const s=JSON.parse('{"title":"User Manual for Laboratory Information Management System (LIMS) â€“ ITAM","description":"","frontmatter":{},"headers":[],"relativePath":"ITAM USER MANUAL.md","filePath":"ITAM USER MANUAL.md"}'),n={name:"ITAM USER MANUAL.md"};function l(o,A,i,f,v,Q){return e(),a("div",null,A[0]||(A[0]=[r('<p><img src="data:image/png;base64," alt=""></p><h1 id="user-manual-for-laboratory-information-management-system-lims-â€“-itam" tabindex="-1">User Manual for Laboratory Information Management System (LIMS) â€“ ITAM <a class="header-anchor" href="#user-manual-for-laboratory-information-management-system-lims-â€“-itam" aria-label="Permalink to &quot;User Manual for Laboratory Information Management System (LIMS) â€“ ITAM&quot;">â€‹</a></h1><h3 id="table-of-content" tabindex="-1"><strong>Table of content</strong> <a class="header-anchor" href="#table-of-content" aria-label="Permalink to &quot;**Table of content** {#table-of-content}&quot;">â€‹</a></h3><p><strong><a href="#table-of-content">Table of content 2</a></strong></p><p><a href="#1.-introduction"><strong>1. Introduction 2</strong></a></p><p><a href="#1.1-overview-of-the-web-app">1.1 Overview of the Web App 2</a></p><p><a href="#1.2-key-features-and-benefits">1.2 Key Features and Benefits 3</a></p><p><a href="#1.3-system-requirements">1.3 System Requirements 3</a></p><p><a href="#2.-getting-started"><strong>2. Getting Started 3</strong></a></p><p><a href="#2.1-accessing-the-app">2.1 Accessing the App 3</a></p><p><a href="#3.-dashboard-overview"><strong>3. Dashboard Overview 5</strong></a></p><p><a href="#3.1-top-navigation-bar">3.1 Top Navigation Bar 6</a></p><p><a href="#3.2-sidebar-menu">3.2 Sidebar Menu 7</a></p><p><a href="#3.3-dashboard-content-area">3.3 Dashboard Content Area 8</a></p><p><a href="#4.-inventory-management"><strong>4. Inventory Management 8</strong></a></p><p><a href="#4.1.-accessing-the-inventory-module">4.1. Accessing the Inventory Module 8</a></p><p><a href="#4.2.-viewing-inventory-items">4.2. Viewing Inventory Items 9</a></p><p><a href="#4.3.-adding-a-new-inventory-item">4.3. Adding a New Inventory Item 9</a></p><p><a href="#4.4.-editing-an-inventory-item">4.4. Editing an Inventory Item 10</a></p><p><a href="#4.5.-tracking-inventory-activities">4.5. Tracking Inventory Activities 10</a></p><p><a href="#5.-sample-registration-module"><strong>5. Sample Registration Module 11</strong></a></p><p><a href="#5.1.-accessing-the-sample-module">5.1. Accessing the Sample Module 11</a></p><p><a href="#5.2.-viewing-sample-items">5.2. Viewing Sample Items 11</a></p><p><a href="#5.3.-creating-a-new-sample">5.3. Creating a New Sample 12</a></p><p><a href="#5.4.-managing-samples">5.4. Managing Samples 13</a></p><p><a href="#6.-payment-module"><strong>6. Payment Module 15</strong></a></p><p><a href="#6.1.-accessing-the-payment-module">6.1. Accessing the Payment Module 15</a></p><p><a href="#6.2.-viewing-payment-details">6.2. Viewing Payment Details 15</a></p><p><a href="#6.3.-adding-payment-records">6.3. Adding Payment Records 16</a></p><p><a href="#6.4.-payment-records">6.4. Payment Records 17</a></p><p><a href="#6.5.-payment-status-types">6.5. Payment Status Types 18</a></p><p><a href="#6.6.-managing-receipts">6.6. Managing Receipts 18</a></p><p><a href="#tips">Tips 19</a></p><p><a href="#7.-user-management-module"><strong>7. User Management Module 19</strong></a></p><p><a href="#7.1.-accessing-the-user-management-module">7.1. Accessing the User Management Module 19</a></p><p><a href="#7.2.-creating-new-users">7.2. Creating New Users 20</a></p><p><a href="#7.3.-managing-user-accounts">7.3. Managing User Accounts 21</a></p><p><a href="#7.4.-editing-user-information">7.4. Editing User Information 21</a></p><p><a href="#7.5.-user-roles-and-permissions">7.5. User Roles and Permissions 22</a></p><p><a href="#tips-1">Tips 22</a></p><h3 id="" tabindex="-1"><a class="header-anchor" href="#" aria-label="Permalink to &quot;&quot;">â€‹</a></h3><h3 id="1.-introduction" tabindex="-1"><strong>1. Introduction</strong> <a class="header-anchor" href="#1.-introduction" aria-label="Permalink to &quot;**1\\. Introduction** {#1.-introduction}&quot;">â€‹</a></h3><h4 id="1.1-overview-of-the-web-app" tabindex="-1"><strong>1.1 Overview of the Web App</strong> <a class="header-anchor" href="#1.1-overview-of-the-web-app" aria-label="Permalink to &quot;**1.1 Overview of the Web App** {#1.1-overview-of-the-web-app}&quot;">â€‹</a></h4><p>The Laboratory Information Management System (LIMS) for ITAM is a web-based application designed to streamline the management of laboratory resources, including sample registrations, inventory tracking, and payment processing. The system supports role-based access control, ensuring that users can efficiently perform tasks relevant to their roles while maintaining data security.</p><h4 id="1.2-key-features-and-benefits" tabindex="-1"><strong>1.2 Key Features and Benefits</strong> <a class="header-anchor" href="#1.2-key-features-and-benefits" aria-label="Permalink to &quot;**1.2 Key Features and Benefits** {#1.2-key-features-and-benefits}&quot;">â€‹</a></h4><ul><li><strong>Dashboard Insights:</strong> Provides a comprehensive view of registered products, payment records, and revenue generated.</li><li>Sample <strong>Registration:</strong> Facilitates the systematic recording of new sample into the library database.</li><li><strong>Payment Management:</strong> Tracks payments, generates receipts, and maintains financial records.</li><li><strong>Inventory Management:</strong> Monitors the availability and usage of test kits in real-time.</li><li><strong>Activity Logging:</strong> Keeps detailed records of all user actions for accountability and auditing purposes.</li><li><strong>Role-Based Access Control:</strong> Assigns specific permissions to users based on their roles, ensuring secure and organized access.</li><li><strong>Test Report Generation:</strong> Enables the creation and sharing of detailed reports for completed tests.</li></ul><h4 id="1.3-system-requirements" tabindex="-1"><strong>1.3 System Requirements</strong> <a class="header-anchor" href="#1.3-system-requirements" aria-label="Permalink to &quot;**1.3 System Requirements** {#1.3-system-requirements}&quot;">â€‹</a></h4><p>The web app can be accessed on desktop computers, laptops, tablets, and mobile devices using any modern browser, including Google Chrome, Mozilla Firefox, or Microsoft Edge.</p><h3 id="2.-getting-started" tabindex="-1"><strong>2. Getting Started</strong> <a class="header-anchor" href="#2.-getting-started" aria-label="Permalink to &quot;**2\\. Getting Started** {#2.-getting-started}&quot;">â€‹</a></h3><h4 id="2.1-accessing-the-app" tabindex="-1"><strong>2.1 Accessing the App</strong> <a class="header-anchor" href="#2.1-accessing-the-app" aria-label="Permalink to &quot;**2.1 Accessing the App** {#2.1-accessing-the-app}&quot;">â€‹</a></h4><p>To access the Library Information Management System (LIMS), a valid account is required.</p><ul><li><strong>If you do not have an account:</strong> Please contact your system administrator to have one created for you.</li><li><strong>If you already have an account:</strong> Follow these steps to log in:</li></ul><ol><li><strong>Open a Web Browser</strong><br> Launch a modern web browser such as Google Chrome, Mozilla Firefox, or Microsoft Edge.<br><img src="data:image/png;base64," alt=""></li><li><strong>Enter the App URL</strong><br> Type <strong>10.0.2.101:8000</strong> into the address bar of your browser as shown below and press <strong>Enter</strong>.<br><img src="data:image/png;base64," alt=""><br> You will be directed to the login page:<br><img src="data:image/png;base64," alt=""></li><li><strong>Log In to Your Account</strong><ul><li>On the login page, enter your registered uhas email (eg. <a href="mailto:me@uhas.edu.gh" target="_blank" rel="noreferrer">me@uhas.edu.gh</a>) and password.</li><li>Click the <strong>Sign in</strong> button to access the system.</li></ul></li><li><strong>Navigate the Dashboard</strong><br> After a successful login, you will be directed to the dashboard, where you can begin using the features based on your assigned role.</li></ol><h3 id="3.-dashboard-overview" tabindex="-1"><strong>3. Dashboard Overview</strong> <a class="header-anchor" href="#3.-dashboard-overview" aria-label="Permalink to &quot;**3\\. Dashboard Overview** {#3.-dashboard-overview}&quot;">â€‹</a></h3><p>The dashboard is the central hub of the Library Information Management System (LIMS). It provides a summary of the system&#39;s key metrics, recent activities, and quick access to critical functionalities.</p><p><img src="data:image/png;base64," alt=""></p><h4 id="3.1-top-navigation-bar" tabindex="-1"><strong>3.1 Top Navigation Bar</strong> <a class="header-anchor" href="#3.1-top-navigation-bar" aria-label="Permalink to &quot;**3.1 Top Navigation Bar** {#3.1-top-navigation-bar}&quot;">â€‹</a></h4><p><img src="data:image/png;base64," alt=""></p><p>The top bar provides essential tools:</p><ul><li><strong>Search Bar:</strong> Quickly find specific records or information by entering keywords.</li><li><strong>Notifications Icon:</strong> Displays system notifications for pending tasks or updates.</li><li><strong>User Profile:</strong> Access account settings or log out.</li></ul><h4 id="-1" tabindex="-1"><a class="header-anchor" href="#-1" aria-label="Permalink to &quot;&quot;">â€‹</a></h4><h4 id="3.2-sidebar-menu" tabindex="-1"><strong>3.2 Sidebar Menu</strong> <a class="header-anchor" href="#3.2-sidebar-menu" aria-label="Permalink to &quot;**3.2 Sidebar Menu** {#3.2-sidebar-menu}&quot;">â€‹</a></h4><p>Located on the left side of the screen, the sidebar menu provides quick access to the system&#39;s main modules.</p><p><strong>Dashboard:</strong> View an overview of key metrics and system activities.</p><p><strong>Inventories:</strong> Manage and track laboratory inventory items.</p><p><strong>Payments:</strong> Record and monitor financial transactions.</p><p><strong>Samples:</strong> Register and track test samples.</p><p><strong>Producers:</strong> Manage details of sample producers.</p><p><strong>Lab Management:</strong> Includes submenus like:</p><ul><li><p><strong>Dosage Forms</strong></p><ul><li><strong>Storage Locations</strong></li><li><strong>Templates</strong></li><li><strong>Tests</strong></li></ul><p><strong>Settings &amp; Logs:</strong> Configure system preferences and view activity logs:</p><ul><li><strong>Permissions</strong></li><li><strong>Roles</strong></li><li><strong>Users</strong></li><li><strong>Activity Logs</strong></li></ul></li></ul><h4 id="-2" tabindex="-1"><a class="header-anchor" href="#-2" aria-label="Permalink to &quot;&quot;">â€‹</a></h4><h4 id="-3" tabindex="-1"><a class="header-anchor" href="#-3" aria-label="Permalink to &quot;&quot;">â€‹</a></h4><h4 id="3.3-dashboard-content-area" tabindex="-1"><strong>3.3 Dashboard Content Area</strong> <a class="header-anchor" href="#3.3-dashboard-content-area" aria-label="Permalink to &quot;**3.3 Dashboard Content Area** {#3.3-dashboard-content-area}&quot;">â€‹</a></h4><p>The central area displays detailed information, including:</p><ul><li><strong>Key Metrics:</strong> Revenue, Unrealized Payments, and Pending Payments.</li><li><strong>Graphs:</strong> Visual representation of revenue trends.</li><li><strong>Latest Payments and Samples:</strong> Overview of recent transactions and sample registrations.</li></ul><p><img src="data:image/png;base64," alt=""></p><h3 id="4.-inventory-management" tabindex="-1"><strong>4. Inventory Management</strong> <a class="header-anchor" href="#4.-inventory-management" aria-label="Permalink to &quot;**4\\. Inventory Management** {#4.-inventory-management}&quot;">â€‹</a></h3><p>The Inventory Module helps you manage and track available stock, including quantities, expiry dates, and storage locations.</p><h4 id="4.1.-accessing-the-inventory-module" tabindex="-1"><strong>4.1. Accessing the Inventory Module</strong> <a class="header-anchor" href="#4.1.-accessing-the-inventory-module" aria-label="Permalink to &quot;**4.1. Accessing the Inventory Module** {#4.1.-accessing-the-inventory-module}&quot;">â€‹</a></h4><ol><li>Log in to the system.</li><li>Click on <strong>Inventories</strong> from the left sidebar to view the inventory list.</li></ol><h4 id="4.2.-viewing-inventory-items" tabindex="-1"><strong>4.2. Viewing Inventory Items</strong> <a class="header-anchor" href="#4.2.-viewing-inventory-items" aria-label="Permalink to &quot;**4.2. Viewing Inventory Items** {#4.2.-viewing-inventory-items}&quot;">â€‹</a></h4><p>The <strong>Inventory List</strong> page displays:</p><ul><li><strong>Name</strong> of the item</li><li><strong>Total Quantity</strong> available</li><li><strong>Expiry Date</strong></li><li><strong>Status</strong> (Available or Unavailable)</li><li><strong>Storage Location</strong></li><li><strong>Actions</strong> (View, Edit, Activities)</li></ul><p>To view details of an inventory item:</p><ol><li>Click <strong>View</strong> next to the desired item.</li><li>The itemâ€™s details, including quantity and storage location, will be displayed</li></ol><p><img src="data:image/png;base64," alt=""></p><h4 id="4.3.-adding-a-new-inventory-item" tabindex="-1"><strong>4.3. Adding a New Inventory Item</strong> <a class="header-anchor" href="#4.3.-adding-a-new-inventory-item" aria-label="Permalink to &quot;**4.3. Adding a New Inventory Item** {#4.3.-adding-a-new-inventory-item}&quot;">â€‹</a></h4><ol><li>Click the <strong>New Inventory</strong> button.</li><li>Fill in the required fields: <ul><li><strong>Name</strong>: Enter the item name (e.g., Distilled Water).</li><li><strong>Unit</strong>: Select the unit of measurement (L, kg, etc.).</li><li><strong>Total Quantity</strong>: Enter the stock quantity.</li><li><strong>Expiry Date</strong>: Set the expiry date.</li><li><strong>Storage Location</strong>: Choose where the item is stored.</li><li><strong>Item Variants</strong>: Add different variations if needed (e.g., different pack sizes).</li></ul></li><li>Click <strong>Create</strong> to save or <strong>Create &amp; Create Another</strong> to add another item.</li></ol><p><img src="data:image/png;base64," alt=""></p><h4 id="4.4.-editing-an-inventory-item" tabindex="-1"><strong>4.4. Editing an Inventory Item</strong> <a class="header-anchor" href="#4.4.-editing-an-inventory-item" aria-label="Permalink to &quot;**4.4. Editing an Inventory Item** {#4.4.-editing-an-inventory-item}&quot;">â€‹</a></h4><ol><li>Locate the item in the <strong>Inventory List</strong>.</li><li>Click <strong>Edit</strong> next to the item.</li><li>Modify the necessary fields: <ul><li>Update <strong>Total Quantity</strong>, <strong>Expiry Date</strong>, or <strong>Storage Location</strong>.</li><li>Adjust <strong>Item Variants</strong> if applicable.</li></ul></li><li>Click <strong>Save Changes</strong> to update the inventory.</li></ol><h4 id="4.5.-tracking-inventory-activities" tabindex="-1"><strong>4.5. Tracking Inventory Activities</strong> <a class="header-anchor" href="#4.5.-tracking-inventory-activities" aria-label="Permalink to &quot;**4.5. Tracking Inventory Activities** {#4.5.-tracking-inventory-activities}&quot;">â€‹</a></h4><ol><li>Click <strong>Activities</strong> next to an item in the inventory list.</li><li>View logs of stock changes, including restocking and updates.</li></ol><h3 id="5.-sample-registration-module" tabindex="-1"><strong>5. Sample Registration Module</strong> <a class="header-anchor" href="#5.-sample-registration-module" aria-label="Permalink to &quot;**5\\. Sample Registration Module** {#5.-sample-registration-module}&quot;">â€‹</a></h3><p>The Sample Module helps you manage and track laboratory samples, including product information, testing requirements, and results. This manual explains how to navigate and use the sample management system efficiently.</p><h4 id="5.1.-accessing-the-sample-module" tabindex="-1"><strong>5.1. Accessing the Sample Module</strong> <a class="header-anchor" href="#5.1.-accessing-the-sample-module" aria-label="Permalink to &quot;**5.1. Accessing the Sample Module** {#5.1.-accessing-the-sample-module}&quot;">â€‹</a></h4><ol><li>Log in to the system.</li><li>Click on <strong>Samples</strong> from the left sidebar to view the sample list.</li></ol><p>![][image10]</p><h4 id="5.2.-viewing-sample-items" tabindex="-1"><strong>5.2. Viewing Sample Items</strong> <a class="header-anchor" href="#5.2.-viewing-sample-items" aria-label="Permalink to &quot;**5.2. Viewing Sample Items** {#5.2.-viewing-sample-items}&quot;">â€‹</a></h4><p>The <strong>Sample List</strong> page displays:</p><ul><li><strong>Serial Code</strong> of the sample</li><li><strong>Name</strong> of the product</li><li><strong>Producer</strong> details</li><li><strong>Quantity</strong> collected</li><li><strong>Status</strong> (Collected, In Progress, Completed)</li><li><strong>Total Cost</strong></li><li><strong>Actions button</strong> and Activities</li></ul><p>To view details of a sample:</p><ol><li>Click <strong>on</strong> the desired sample</li><li>The sample&#39;s complete details will be displayed</li></ol><h4 id="5.3.-creating-a-new-sample" tabindex="-1"><strong>5.3. Creating a New Sample</strong> <a class="header-anchor" href="#5.3.-creating-a-new-sample" aria-label="Permalink to &quot;**5.3. Creating a New Sample** {#5.3.-creating-a-new-sample}&quot;">â€‹</a></h4><ol><li>Click the <strong>New Sample</strong> button</li><li>Complete the three-step process: <strong>Step 1: Product Information</strong></li><li>Fill in the required fields<br><strong><img src="data:image/png;base64," alt=""></strong><ul><li>click the <strong>Next</strong> button to continue.</li></ul></li><li><strong>Step 2: Manufacturer Information</strong><ul><li>Fill in the required fields<br><strong><img src="data:image/png;base64," alt=""></strong></li><li>Click the <strong>Next</strong> button to continue.</li></ul></li><li><strong>Step 3: Test Information</strong><ul><li><strong>Tests</strong>: Select required tests (The total cost will be calculated automatically)<br><img src="data:image/png;base64," alt=""></li><li>Click <strong>Create</strong> to save the sample</li></ul></li></ol><h4 id="5.4.-managing-samples" tabindex="-1"><strong>5.4. Managing Samples</strong> <a class="header-anchor" href="#5.4.-managing-samples" aria-label="Permalink to &quot;**5.4. Managing Samples** {#5.4.-managing-samples}&quot;">â€‹</a></h4><ol><li><p>Use status filters to view samples by stage:</p><ul><li><strong>All</strong>: View all samples</li><li><strong>Collected</strong>: Newly received samples</li><li><strong>In Progress</strong>: Samples under testing</li><li><strong>Completed</strong>: Finished samples</li></ul></li><li><p>Available actions for each sample:</p><ul><li><strong>View</strong>: See complete details</li><li><strong>Edit</strong>: Modify sample information</li><li><strong>Print Report</strong>: Generate sample report</li><li><strong>Recommendations</strong>: View test recommendations</li><li><strong>Activities</strong>: Track sample history</li></ul></li></ol><h3 id="6.-payment-module" tabindex="-1"><strong>6. Payment Module</strong> <a class="header-anchor" href="#6.-payment-module" aria-label="Permalink to &quot;**6\\. Payment Module** {#6.-payment-module}&quot;">â€‹</a></h3><p>The Payment Module helps you track and manage payments for laboratory samples, including payment status, records, and receipts. This section explains how to navigate and use the payment system efficiently.</p><h4 id="6.1.-accessing-the-payment-module" tabindex="-1"><strong>6.1. Accessing the Payment Module</strong> <a class="header-anchor" href="#6.1.-accessing-the-payment-module" aria-label="Permalink to &quot;**6.1. Accessing the Payment Module** {#6.1.-accessing-the-payment-module}&quot;">â€‹</a></h4><ol><li>Log in to the system</li><li>Click on <strong>Payments</strong> from the left sidebar to view the payment list.</li></ol><h4 id="6.2.-viewing-payment-details" tabindex="-1"><strong>6.2. Viewing Payment Details</strong> <a class="header-anchor" href="#6.2.-viewing-payment-details" aria-label="Permalink to &quot;**6.2. Viewing Payment Details** {#6.2.-viewing-payment-details}&quot;">â€‹</a></h4><ol><li>Click any payment record or <strong>View</strong> next to any payment record</li><li>The payment details page shows: <ul><li>Product Details</li><li>Product Name</li><li>Amount Due</li><li>Amount Paid</li><li>Balance Due</li><li>Serial Code</li><li>Payment Status</li><li>Payment Records table</li><li>Receipt button (top right)</li></ul></li></ol><p><img src="data:image/png;base64," alt=""></p><h4 id="6.3.-adding-payment-records" tabindex="-1"><strong>6.3. Adding Payment Records</strong> <a class="header-anchor" href="#6.3.-adding-payment-records" aria-label="Permalink to &quot;**6.3. Adding Payment Records** {#6.3.-adding-payment-records}&quot;">â€‹</a></h4><ol><li>Click <strong>New payment record</strong> on the payment details page</li><li>Fill in the required fields: <ul><li><strong>Amount</strong>: Enter payment amount (in GHS)</li><li><strong>Payment Method</strong>: Select payment method (e.g., Cash)</li><li><strong>Note</strong>: Add any additional information (optional)</li></ul></li><li>Click one of these options: <ul><li><strong>Create</strong>: Save and return</li><li><strong>Create &amp; create another</strong>: Save and add another payment</li><li><strong>Cancel</strong>: Discard changes</li></ul></li></ol><p><img src="data:image/png;base64," alt=""></p><h4 id="6.4.-payment-records" tabindex="-1"><strong>6.4. Payment Records</strong> <a class="header-anchor" href="#6.4.-payment-records" aria-label="Permalink to &quot;**6.4. Payment Records**  {#6.4.-payment-records}&quot;">â€‹</a></h4><p>The payment records section shows:</p><ul><li>Amount paid</li><li>Payment method</li><li>Transaction ID</li><li>Received by</li><li>Date received</li></ul><h4 id="6.5.-payment-status-types" tabindex="-1"><strong>6.5. Payment Status Types</strong> <a class="header-anchor" href="#6.5.-payment-status-types" aria-label="Permalink to &quot;**6.5. Payment Status Types** {#6.5.-payment-status-types}&quot;">â€‹</a></h4><p>Payments can have the following statuses:</p><ul><li><strong>Pending</strong>: No payment received</li><li><strong>Part Payment</strong>: Partial amount paid</li><li><strong>Paid</strong>: Full amount received</li></ul><h4 id="6.6.-managing-receipts" tabindex="-1"><strong>6.6. Managing Receipts</strong> <a class="header-anchor" href="#6.6.-managing-receipts" aria-label="Permalink to &quot;**6.6. Managing Receipts** {#6.6.-managing-receipts}&quot;">â€‹</a></h4><ol><li>Click the <strong>Receipt</strong> button on the payment details page</li><li>View or print the receipt for record-keeping</li></ol><h4 id="tips" tabindex="-1"><strong>Tips</strong> <a class="header-anchor" href="#tips" aria-label="Permalink to &quot;**Tips** {#tips}&quot;">â€‹</a></h4><ul><li>Use the search bar to find specific payments by <strong>Serial Code</strong> of the sample (eg. ITAM/CA/003/01-25)</li><li>All amounts are displayed in Ghana Cedis (GHS)</li><li>Always verify amounts before creating payment records</li></ul><h3 id="7.-user-management-module" tabindex="-1"><strong>7. User Management Module</strong> <a class="header-anchor" href="#7.-user-management-module" aria-label="Permalink to &quot;**7\\. User Management Module** {#7.-user-management-module}&quot;">â€‹</a></h3><p>The User Management Module allows administrators to create, manage, and monitor user accounts within the system. This section explains how to effectively use the user management features to maintain proper access control and user permissions.</p><h4 id="7.1.-accessing-the-user-management-module" tabindex="-1"><strong>7.1. Accessing the User Management Module</strong> <a class="header-anchor" href="#7.1.-accessing-the-user-management-module" aria-label="Permalink to &quot;**7.1. Accessing the User Management Module** {#7.1.-accessing-the-user-management-module}&quot;">â€‹</a></h4><ol><li>Log in to the system</li><li>Click on <strong>Users</strong> under the Settings &amp; Logs section in the left sidebar</li></ol><h4 id="7.2.-creating-new-users" tabindex="-1"><strong>7.2. Creating New Users</strong> <a class="header-anchor" href="#7.2.-creating-new-users" aria-label="Permalink to &quot;**7.2. Creating New Users** {#7.2.-creating-new-users}&quot;">â€‹</a></h4><p>To add a new user to the system:</p><ol><li>Click the <strong>New user</strong> button in the top right corner<br><img src="data:image/png;base64," alt=""></li><li>Fill in the required fields: <ul><li><strong>Name</strong>: Enter the user&#39;s full name</li><li><strong>Email</strong>: Enter the institutional email address (@uhas.edu.gh domain).</li><li><strong>Role</strong>: Select from available options: <ul><li>Administrator</li><li>Technician</li><li>Accountant</li><li>Receptionist</li><li>Store Keeper</li></ul></li></ul></li><li>Choose one of these actions: <ul><li><strong>Create</strong>: Save and return to user list</li><li><strong>Create &amp; create another</strong>: Save and add another user</li><li><strong>Cancel</strong>: Discard changes</li></ul></li></ol><h4 id="7.3.-managing-user-accounts" tabindex="-1"><strong>7.3. Managing User Accounts</strong> <a class="header-anchor" href="#7.3.-managing-user-accounts" aria-label="Permalink to &quot;**7.3. Managing User Accounts**  {#7.3.-managing-user-accounts}&quot;">â€‹</a></h4><p>When a new account is created:</p><ul><li>The system generates a default password</li><li>A success message appears with the password</li><li>The user should change this password upon first login</li></ul><h4 id="7.4.-editing-user-information" tabindex="-1"><strong>7.4. Editing User Information</strong> <a class="header-anchor" href="#7.4.-editing-user-information" aria-label="Permalink to &quot;**7.4. Editing User Information**  {#7.4.-editing-user-information}&quot;">â€‹</a></h4><p>To modify user details:</p><ol><li>Click <strong>Edit</strong> next to the user&#39;s name</li><li>Update any of these fields: <ul><li>Name</li><li>Email</li><li>Role</li><li>Account status (active/inactive)</li></ul></li><li>Choose an action: <ul><li><strong>Save changes</strong>: Confirm modifications</li><li><strong>Cancel</strong>: Discard changes</li></ul></li></ol><p><strong><img src="data:image/png;base64," alt=""></strong></p><h4 id="7.5.-user-roles-and-permissions" tabindex="-1"><strong>7.5. User Roles and Permissions</strong> <a class="header-anchor" href="#7.5.-user-roles-and-permissions" aria-label="Permalink to &quot;**7.5. User Roles and Permissions**  {#7.5.-user-roles-and-permissions}&quot;">â€‹</a></h4><p>Available roles include:</p><ul><li><strong>Administrator</strong>: Full system access</li><li><strong>Technician</strong>: Lab testing</li><li><strong>Accountant</strong>: Financial operations</li><li><strong>Receptionist</strong>: Front desk operation and sample registration</li><li><strong>Store Keeper</strong>: Inventory management</li></ul><h4 id="tips-1" tabindex="-1"><strong>Tips</strong> <a class="header-anchor" href="#tips-1" aria-label="Permalink to &quot;**Tips** {#tips-1}&quot;">â€‹</a></h4><ul><li>Use institutional email addresses only (@uhas.edu.gh)</li><li>Share default passwords securely</li><li>Encourage immediate password changes</li></ul><p>[image10]: <a href="data:image/png;base64," target="_blank" rel="noreferrer">data:image/png;base64,</a></p>',147)]))}const p=t(n,[["render",l]]);export{s as __pageData,p as default};
